amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"823349","type":"CustomJS"},{"attributes":{},"id":"823339","type":"AllLabels"},{"attributes":{"fill_alpha":0.1,"fill_color":"#ffffea","hatch_alpha":0.1,"line_alpha":0.1,"line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"823041","type":"Patch"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"size":{"value":8},"x":{"value":1258},"y":{"value":0.0997253309439984}},"id":"823078","type":"Scatter"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"822983","type":"WheelZoomTool"},{"attributes":{},"id":"823284","type":"AllLabels"},{"attributes":{},"id":"822972","type":"LinearScale"},{"attributes":{},"id":"822986","type":"RedoTool"},{"attributes":{"children":[[{"id":"823006"},0,0],[{"id":"823152"},1,0],[{"id":"822966"},2,0],[{"id":"823203"},3,0],[{"id":"823294"},4,0]]},"id":"823434","type":"G
